import { ShopContext } from "./Context";

export default function Products(props){

    const { products } = useContext(ShopContext);


    return(


        <div>
            {products.filter(i => {
                <div className="product"><img src={props.key[i].image_link} alt="" /></div>
            } )}
        </div>

    )
}
